Let's break down this problem into smaller parts. Firstly, let us convert the quantities mentioned (dozen) which means 12 units or items per 'dozen'. Thus;
Glasses initially: 8 Dozens= 8*12 Glasses = 96 Glasses
Plates initially : 4 Dozens = 4*12 Plates = 48 Plates
On returning these back home, it was found out that 10 glasses were broken whereas 6 plates also met similar fate due possibly mishandling during transportation etc.. This implies subtraction operation here since fewerer than original count remains post damage caused...😞 hence new counts become ;
Unbroken glasses remain: 96 - 10 = 86 Unbroken Glasses ♨️
Damage free dishes remain: 48 - 6 = 42 Damnfree Dishes . These can still serve its purpose though not perfect like before!
